Here's an example response in json format:

```
{
  "matching": true,
  "saliency_explanation_table": {
    "ltable_Beer_Name": 0.2,
    "ltable_Brew_Factory_Name": 0.1,
    "ltable_Style": 0.3,
    "ltable_ABV": 0.4
  },
  "counterfactual_explanation_table": {
    "ltable_Beer_Name": "Rude Hippo Honey Basil Amber",
    "ltable_Brew_Factory_Name": "18th Street Brewery",
    "ltable_Style": "Amber Ale",
    "ltable_ABV": "7.40 %"
  }
}
```

In this example, the AI model predicts a match between the two records. The saliency explanation table shows the saliency scores for each input token, indicating that the ABV attribute had the most influence on the model's decision. The counterfactual explanation table shows the altered input values for each token that would result in a non-match prediction.

Here is an example of how you can get the yes/no response, saliency explanation, and counterfactual explanation using a pre-trained Entity Resolution model:

```json
{
    "yes_no_response": "No",
    "saliency_explanation": {
        "ltable_Beer_Name": 0.1,
        "ltable_Brew_Factory_Name": 0.4,
        "ltable_Style": 0.2,
        "ltable_ABV": 0.3
    },
    "counterfactual_explanation": {
        "ltable_Beer_Name": "Council Rock Sleeping Lion Red Ale",
        "ltable_Brew_Factory_Name": "Council Rock Brewery",
        "ltable_Style": "Irish Ale",
        "ltable_ABV": "6 %"
    }
}
```

The yes/no response indicates that the two records do not match. The saliency explanation table shows the saliency score for each token in the first record, indicating which tokens contributed the most to the decision. The counterfactual explanation table shows an altered version of the first record that would cause the model to predict a match. In this case, changing all the values in the first record to the corresponding values in the second record results in a match.

